import "./App.css";
import UmlItem from "./UmlItem";
function Umls(props) {
    function deleteTodo(id){
        this.setState((prevState) => ({
            Umllist: prevState.Umllist.filter(item => item.id !== id),
        }))
    }



    return (

            <div>


                <div className="InputUml">
                    {props.items.map(umllist=><UmlItem id={umllist.id} olduml={umllist.olduml}/>)}



                </div>
            </div>

    )
        ;
}

export default Umls;
